import '../styles/styles.css';

const SlidingCards=(props)=> {
  const { data } = props;

  if (!data || data.length < 0) {
      return "No Images Available"
  }


  return (
    <div className="container">
         {
         data.map((el)=> 
            <div className='panel'>
            <img src={el.images} alt = ''/>
          <h3>{el.title}</h3>
        </div>
        )
        }

    </div>
  );
}

export default SlidingCards;
